import axios from "axios"

function LandingPage() {

    useEffect(() => {
      axios.get('api/hello')
      .then(response => console.log(response.data))

    },[])

    return (
      <div>
          <h1>LandingPage 랜딩 페이지</h1>
      </div>
  )

}

export default LandingPage;
